from PIL import Image

im = Image.new("RGB", (200, 200))
pix = im.load()
m = ""
# print(len(m))
res = 0
for x in range(200):
    for y in range(200):
        if m[res] == "0":
            pix[x, y] = (255, 255, 255)
            res += 1
        elif m[res] == "1":
            pix[x, y] = (0, 0, 0)
            res += 1

im = im.resize((256, 256))
im.save("test.png", "PNG")
